import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import logo from "../assets/logo.jpg";
import necklace1 from "../assets/bridal-set1.jpg";
import necklace2 from "../assets/bridal-set2.jpg";
import necklace3 from "../assets/bridal-set3.jpg";

const BridalNecklace = () => {
  const navigate = useNavigate();
  const [search, setSearch] = useState("");

  const necklaces = [
    { name: "Elegant Pearl Necklace", img: necklace1 },
    { name: "Golden Bridal Necklace", img: necklace2 },
    { name: "Diamond Studded Necklace", img: necklace3 },
  ];

  const filtered = necklaces.filter((item) =>
    item.name.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="collection-page" style={{ backgroundColor: "#fffafc" }}>
      {/* Navbar */}
      <header className="navbar" style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        backgroundColor: "#000",
        padding: "15px 40px"
      }}>
        <div className="logo" style={{ display: "flex", alignItems: "center" }}>
          <img
            src={logo}
            alt="Elegant Jewelry Logo"
            style={{ width: "50px", height: "50px", borderRadius: "10px", marginRight: "10px" }}
          />
          <span className="brand-name" style={{ color: "#fff", fontSize: "20px", fontWeight: "600" }}>
            Elegant Jewelry
          </span>
        </div>

        <ul className="nav-links" style={{
          display: "flex",
          listStyle: "none",
          gap: "25px"
        }}>
          <li><a href="/" style={{ color: "#fff", textDecoration: "none", fontWeight: "500" }}>Home</a></li>
          <li><a href="/about" style={{ color: "#fff", textDecoration: "none", fontWeight: "500" }}>About</a></li>
          <li><a href="/collections" style={{ color: "#fff", textDecoration: "none", fontWeight: "500" }}>Collections</a></li>
        </ul>
      </header>

      {/* Search bar */}
      <div className="search-bar" style={{ textAlign: "center", margin: "40px 0" }}>
        <input
          type="text"
          placeholder="Search Necklace..."
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          style={{
            padding: "10px 20px",
            borderRadius: "25px",
            border: "2px solid #d6336c",
            width: "260px",
            outline: "none",
            color: "#333"
          }}
        />
        <button
          style={{
            marginLeft: "10px",
            padding: "10px 20px",
            borderRadius: "25px",
            border: "none",
            backgroundColor: "#d6336c",
            color: "white",
            fontWeight: "500",
            cursor: "pointer"
          }}
        >
          Search
        </button>
      </div>

      {/* Necklace Collection Grid */}
      <div className="collections-grid" style={{
        display: "flex",
        justifyContent: "center",
        flexWrap: "wrap",
        gap: "30px",
        paddingBottom: "50px"
      }}>
        {filtered.map((item, index) => (
          <div key={index} className="collection-card" style={{
            width: "280px",
            backgroundColor: "#fff",
            borderRadius: "15px",
            boxShadow: "0 4px 10px rgba(0,0,0,0.1)",
            textAlign: "center",
            overflow: "hidden"
          }}>
            <img
              src={item.img}
              alt={item.name}
              style={{ width: "100%", height: "250px", objectFit: "cover" }}
            />
            <div style={{ padding: "15px" }}>
              <h3 style={{ color: "#d6336c", fontSize: "18px", marginBottom: "10px" }}>{item.name}</h3>

              <div style={{ display: "flex", flexDirection: "column", gap: "10px" }}>
                <button
                  style={{
                    backgroundColor: "#d6336c",
                    color: "white",
                    border: "none",
                    padding: "8px 20px",
                    borderRadius: "20px",
                    cursor: "pointer"
                  }}
                  onClick={() => alert(`Buying ${item.name}`)}
                >
                  Buy Now
                </button>

                <button
                  style={{
                    backgroundColor: "#ff8fa3",
                    color: "white",
                    border: "none",
                    padding: "8px 20px",
                    borderRadius: "20px",
                    cursor: "pointer"
                  }}
                  onClick={() => alert(`${item.name} added to cart`)}
                >
                  Add to Cart
                </button>

                <button
                  style={{
                    backgroundColor: "#ffa6c1",
                    color: "white",
                    border: "none",
                    padding: "8px 20px",
                    borderRadius: "20px",
                    cursor: "pointer"
                  }}
                  onClick={() => alert(`${item.name} added to wishlist`)}
                >
                  Add to Wishlist
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* Footer */}
      <footer style={{
        backgroundColor: "#000",
        color: "#fff",
        padding: "25px 0",
        textAlign: "center",
        marginTop: "auto"
      }}>
        <p>Â© 2025 Elegant Jewelry. All Rights Reserved.</p>
      </footer>
    </div>
  );
};

export default BridalNecklace;
